script: |
  super -f text -I q4331.spq | sort > q4331.out

inputs:
  - name: q4331.spq
    data: |
      SELECT col2 * - - 75 + + + col2 + + col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT col2 NOT BETWEEN + 84 * + + col0 AND CAST ( NULL AS INTEGER );
  - name: tab0

outputs:
  - name: q4331.out
    data: |
